	add("spam", "{\"term\":\"spam\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"The original sense (canned ham) is a proprietary name registered by Geo. A. Hormel \u0026amp; Co. in U.S., 1937. It is presumed to be a conflation of either \u0027sp\u0027iced h\u0027am\u0027 or \u0027s\u0027houlder of \u0027p\u0027ork and h\u0027am\u0027\u0026lt;ref\u0026gt;[http://www.spam.com/spam-101/what-does-the-spam-brand-name-mean What does the Spam brand name mean?]\u0026lt;/ref\u0026gt; but was soon extended to other kinds of canned meat.The use for unsolicited and unwanted email derives from a w:Monty Python|Monty Python sketch ([http://us.imdb.com/title/tt0650991/ Flying Circus, Episode 25]). In the 1970 sketch, a group of Vikings in a restaurant repeatedly chant the word \u0026quot;spam\u0026quot;. See SPAM. The earliest recorded real-life use for this sense occurs around [http://www.templetons.com/brad/spamterm.html 1993] which finds reference in an [http://groups.google.com/group/alt.folklore.computers/browse_frm/thread/3f760db408bb109c/dc98a1f9c6a59477 email] dated March 31, 1993.The term appears to have been used earlier in a different sense in relation to \u0026quot;multi-user dungeon|Multi-User Dungeons\u0026quot; (MUDs), a kind of multi-user computer gaming environment before widespread use of the Internet, in the 1980s.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A collection of unsolicited bulk electronic messages\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dIn America alone, people spent $170 billion on “direct marketing”—junk mail of both the physical and electronic varieties—last year. Yet of those who received unsolicited adverts through the post, only 3% bought anything as a result. If the bumf arrived electronically, the take-up rate was 0.1%. And for online adverts the “conversion” into sales was a minuscule 0.01%. That means about $165 billion was spent not on drumming up business, but on annoying people, creating landfill and cluttering \u0027\u0027spam\u0027\u0027 filters\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any undesired electronic content automatically generated for commercial purposes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An unsolicited electronic message sent in bulk, usually by email or newsgroups\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"tinned meat product\", \"priority\":5}]}, \"synonyms\":{}}");

