	add("spaceship", "{\"term\":\"spaceship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|space|ship|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vehicle that flies through space\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A finite pattern that reappears after a certain number of generations in the same orientation but in a different position\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Richard Nowakowski, \u0027More Games of No Chance\u0027 (page 433\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"We describe software that searches for \u0027\u0027spaceships\u0027\u0027 in Conway\u0027s Game of Life and related two-dimensional cellular automata\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Andrew Adamatzky, \u0027Game of Life Cellular Automata\u0027 (page 126\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Synthesis of \u0027\u0027spaceship\u0027\u0027 flotillas is even more complicated than synthesis of oscillators, since spaceships are like oscillators that mov\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The operator \u0026lt;code\u0026gt;\u0026lt;\u003d\u0026gt;\u0026lt;/code\u0026gt; in the Perl programming language, which compares two values and indicates whether the first is lesser than, greater than, or equal to the second\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Randal Schwartz, ‎Brian Foy, ‎Tom Phoenix, \u0027Intermediate Perl\u0027 (page 142\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"If we reverse the positions of \u0026lt;code\u0026gt;$a\u0026lt;/code\u0026gt; and \u0026lt;code\u0026gt;$b\u0026lt;/code\u0026gt;, the \u0027\u0027spaceship\u0027\u0027 will sort in the opposite order\", \"priority\":9}]}, \"synonyms\":{}}");

	add("spacetime", "{\"term\":\"spacetime\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|space|time|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The four-dimensional continuum of the three spatial dimensions plus time\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An event is a point in \u0027\u0027spacetime\u0027\u0027, specified by the coordinates \u0027x\u0027, \u0027y\u0027, \u0027z\u0027 and \u0027t\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An \u0027n\u0027-dimensional continuum consisting of dimensions of both space and time. Normally spacetime is considered as having 4 dimensions (\u0027x\u0027, \u0027y\u0027, \u0027z\u0027, \u0027t\u0027), but higher-dimensional spacetimes are often encountered in theoretical physics, e.g. the 5-dimensional spacetime of Kaluza-Klein theory or the 11 dimensions of spacetime in M-theory\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A specific region of the universe with mathematically different properties than the surrounding spacetime. Synonymous with \u0026quot;metric\u0026quot; within the context of general relativity\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;a Schwarzschild spacetime,\u0026quot; \u0026quot;a Reissner-Nordström spacetime,\u0026quot; etc. as opposed to sense (2) describing the universe\u0027s spacetime as a whole: \u0026quot;a Minkowski spacetime,\u0026quot; \u0026quot;a 5-dimensional spacetime,\u0026quot; etc\", \"priority\":5}]}, \"synonyms\":{}}");

