	add("spadework", "{\"term\":\"spadework\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"spade + work\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Work done by digging with a spade\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Work done in preparation for something else\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There\u0027s a lot of \u0027\u0027spadework\u0027\u0027 to be done before the scheme can be implemented\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"section\u003dchapter passage\u003dRemoving a portion of chair which had got entangled in my back hair, I said with a candour that became me well: “I was looking for a mouse.” If she had replied, “Ah, yes, indeed. I understand now. A mouse, to be sure. Quite,” everything would have been nice and smooth, but she didn\u0027t. “A mouse?” she said. “What do you mean?” Well, of course, if she didn\u0027t know what a mouse was, there was evidently a good deal of tedious \u0027\u0027spadework\u0027\u0027 before us, and one would scarcely have known where to start\", \"priority\":4}]}, \"synonyms\":{}}");

	add("spadix", "{\"term\":\"spadix\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Via Latin from Ancient greek (to 1453) literally \u0026quot;palm branch.\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fleshy spike (inflorescence) with reduced flowers, usually enclosed by a spathe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A special organ of the nautilus, due to a modification of the posterior tentacles\", \"priority\":2}]}, \"synonyms\":{}}");

	add("spaghetti", "{\"term\":\"spaghetti\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"Italian (\u0027see Italian etymology below\u0027)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of pasta made in the shape of long thin strings\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A dish that has spaghetti as a main part of it, such as spaghetti bolognese\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Informally, any type of pasta\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Electrical insulating tubing\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Anything tangled or confusing\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A spaghetti western\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A short form of \u0027\u0027spaghetti code\", \"priority\":7}]}, \"synonyms\":{}}");

	add("spaghettini", "{\"term\":\"spaghettini\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"Italian\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a form of thin spaghetti\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spaghettoni", "{\"term\":\"spaghettoni\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"Italian\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of thick spaghetti\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spahi", "{\"term\":\"spahi\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Persian\", \"French\", \"ottoman turkish (1500-1928)\"], \"text\":\"From French \u0027spahi\u0027 from Ottoman turkish (1500-1928) \u0027سپاهی\u0027 from Persian \u0027سپاهی\u0027 (tr\u003dsepâhi) (\u0026gt; English \u0027sepoy\u0027), from \u0027سپاه\u0027 (tr\u003dsepâh)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Ottoman (Turkish empire) cavalryman, especially as recruited under a land-based system\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Orhan Pamuk, \u0027My Name Is Red\u0027, tr. Erdağ M Gökna\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I hear that the great Sadiki Bey illustrated a copy of \u0027Strange Creatures\u0027, commissioned by an Uzbek \u0027\u0027spahi\u0027\u0027 cavalryman, for only forty gold pieces\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A soldier in a mainly Arab-recruited cavalry (originally horse, later light armored) regiment in French colonial service in (former/ in name still) Ottoman North African provinces\", \"priority\":4}]}, \"synonyms\":{}}");

	add("spain", "{\"term\":\"spain\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\", \"phoenician\", \"anglo-norman\"], \"text\":\"From Anglo-norman {{m|fro|Espayne}}, from {{m|la|Spania}}, from earlier Latin {{m|la|Hispānia}}, from Ancient greek (to 1453) {{m|grc|Ἱσπανία}}, from Phoenician {{m|phn|𐤀𐤉-𐤔𐤀𐤐𐤀𐤍𐤉𐤌|tr\u003day-shaphanim|sc\u003dPhnx|lit\u003dhyrax isle}}, as the native wild rabbits were mistaken for hyraxes.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A country in Europe, including most of the Iberian peninsula. Official name: Kingdom of Spain (Reino de España\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1865\u0027\u0027, James Stuart Laurie (editor), \u0027Manual of Elementary Geography\u0027, page 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The mountains of \u0027\u0027Spain\u0027\u0027 consist of parallel ranges, running from east to wes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Stephen P. Reyna, \u0026quot;The Force of Two Logics\u0026quot;, \u0027in\u0027 S. P. Reyna \u0026amp; R. E. Downs (editors), \u0027Deadly Developments: Capitalism, states and war\u0027 (\u0027War and Scoiety\u0027, volume 5), page 3\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Spain\u0027\u0027 fought with France constantly from 1494 through the 1540s, especially over Italy\", \"priority\":5}]}, \"synonyms\":{}}");

	add("spale", "{\"term\":\"spale\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"middle high german (ca. 1050-1500)\", \"Icelandic\", \"Norwegian\", \"old norse\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027spale\u0027 (splinter) perhaps partly from Old english (ca. 450-1100) {{m|ang|*spalu||flat bar, flake, chip}} or Old norse \u0027spǫlr\u0027 (plank, rail, bar, short piece of wood) both from Proto-germanic {{m|gem-pro|*spaluz||pole, rod, thin bar, lath}}; and partly as an alteration of Old english (ca. 450-1100) \u0027speld\u0027 (ember, flake, torch, splinter, thin piece of wood used as a torch) from Proto-germanic {{m|gem-pro|*speldą||that which is split, splinter, board}}; both from Proto-indo-european {{m|ine-pro|*(s)pala-}}, {{m|ine-pro|*(s)pel-||to split in two, split in half}}. Cognate with Middle high german (ca. 1050-1500) \u0027spale\u0027 {{gloss|\u0026quot;rung of a ladder\u0026quot;; \u0026gt; German dialectal \u0027spale\u0027 (a wooden split, wedge) }, Swedish dialectal \u0027spalu\u0027 (splinter) Norwegian dialectal \u0027spel\u0027 \u0027spela\u0027 \u0027spila\u0027 (a splinter) Icelandic \u0027spölur\u0027 (bit, short piece) See also {{l|en|split}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chip or splinter of wood\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A lath; a shaving or chip, as of wood or stone\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A strengthening cross timber\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One of a number of cross-bands fastened temprarily to the frames to keep them in place until properly secured; a spaling\", \"priority\":4}]}, \"synonyms\":{}}");

	add("spalt", "{\"term\":\"spalt\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\"], \"text\":\"Compare German \u0027spalt|lang\u003dde\u0027 () from \u0027spalten|lang\u003dde\u0027 () {{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"spelter\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spallation", "{\"term\":\"spallation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|spall|ation|lang\u003den}}.File:Spallation.gif|thumb|Spallation as a result of impact can occur with or without penetration of the impacting object\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A nuclear reaction in which a nucleus fragments into many nucleons\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Fragmentation due to stress or impact\", \"priority\":2}]}, \"synonyms\":{}}");

	add("spalpeen", "{\"term\":\"spalpeen\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Irish\"], \"text\":\"A late 18th century term, from Irish \u0027spailpín\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A poor migratory farm worker in Ireland, often viewed as a rascal or mischievous and cunning person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A good-for-nothing person, often used so-named during a good humored ridicule\", \"priority\":2}]}, \"synonyms\":{}}");

	add("spamblock", "{\"term\":\"spamblock\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|spam|block|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Text inserted into an email address in order to make it invalid, though still readable to a human being. For example, in \u0026quot;jsmith-[AT]-company-[DOT]-com\u0026quot;, the \u0026quot;@\u0026quot; and \u0026quot;.\u0026quot; symbols have been replaced with literal text to prevent automated spambots from finding the email address while still leaving it readable\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spambot", "{\"term\":\"spambot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|spam|bot|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bot that sends mass junk e-mail\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spamdexing", "{\"term\":\"spamdexing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|spam|indexing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The inclusion of deliberately misleading terms on a website in order to manipulate its ranking in a search engine\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spamvertiser", "{\"term\":\"spamvertiser\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|spamvertise|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who spamvertises\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spanakopita", "{\"term\":\"spanakopita\", \"etymology\":{\"influencers\":[], \"languages\":[\"Greek\", \"English\"], \"text\":\"Modern Greek \u0027σπανακόπιτα\u0027 from \u0027σπανάκι\u0027 (spinach) + \u0027πίτα\u0027 (pie)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Greek dish made with pre-cooked spinach, butter, olive oil, feta cheese, green onions, egg and seasoning in phyllo pastry\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spandex", "{\"term\":\"spandex\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined as an anagram of the word {{m|en|expands}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A synthetic fibre known for its exceptional elasticity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Clothing made from such material\", \"priority\":2}]}, \"synonyms\":{}}");

	add("spangle", "{\"term\":\"spangle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027spangel\u0027 (a small piece of ornamental metal; a small ornament)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small piece of sparkling metallic material sewn on to a garment as decoration; a sequin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|passage\u003dAnd no use for anyone to tell Charles that this was because the Family was in mourning for Mr Granville Darracott […]: Charles might only have been second footman at Darracott Place for a couple of months when that disaster occurred, but no one could gammon him into thinking that my lord cared a \u0027\u0027spangle\u0027\u0027 for his heir\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any small sparkling object\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1606-1687\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the rich \u0027\u0027spangles\u0027\u0027 that adorn the sky\", \"priority\":5}]}, \"synonyms\":{}}");

	add("spanglish", "{\"term\":\"spanglish\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|Spanish|English|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A language blend of English and Spanish spoken by both Latinos and Anglo-Americans, also called \u0027espanglés\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The mixing of Spanish and English together in a sentence\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His Spanglish was quite embarrassing when he said he was \u0026quot;embarazado\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("spaniard", "{\"term\":\"spaniard\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle english (1100-1500) \u0027spaignarde\u0027 from Old french (842-ca. 1400) \u0027espaignard\u0027 from \u0027espaigne\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Somebody born or residing in Spain\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spaniel", "{\"term\":\"spaniel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027espaigneul\u0027 (modern French \u0027épagneul\u0027 , from Latin \u0027hispāniolus\u0027 (spanish) from \u0027hispānia\u0027 (spain)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various small breeds of gun dog having a broad muzzle, long, wavy fur and long ears that hang at the side of the head, bred for flushing and retrieving game\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A cringing, fawning person\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1595\u0027\u0027: Shakespeare, William, \u0027The Two Gentlemen of Verona\u0027 Act IV, Scene I\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Proteus\u0027: Yet, spaniel-like, the more she spurns my love,/The more it grows and fawneth on her still\", \"priority\":4}]}, \"synonyms\":{}}");

	add("spanishing", "{\"term\":\"spanishing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A printing process in which an ink is deposited on the bottoms and sides of depressions formed in a material, usually plastic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spankee", "{\"term\":\"spankee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|spank|ee|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The receiver or victim of a spankin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Frederick Crews, \u0027Postmodern Pooh\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When you add in the kinkier heteros—fetishists, jock sniffers, Jesus freaks, doll collectors, day traders, spankers and \u0027\u0027spankees\u0027\u0027—queers are the moral majority for sure\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Tom Beaudoin, \u0027Consuming Faith: Integrating Who We Are with What We Buy‎\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The spanker is often also the \u0027\u0027spankee\", \"priority\":5}]}, \"synonyms\":{}}");

	add("spanker", "{\"term\":\"spanker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who spanks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An instrument used to give someone a spanking or spank, such as a paddle\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A fore and aft gaff-rigged sail on the aft-most mast of a square-rigged vessel\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A musician who plays his instrument well\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A small coin\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1772\u0027\u0027, \u0027The Town and Country Magazine\u0027 (volume 4, page 344\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Egad, Jack, I am glad to see you, for I want a few \u0027\u0027spankers\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"One who takes long, quick strides in walking\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A swift horse\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Something very large, or larger than usual; a whopper\", \"priority\":10}]}, \"synonyms\":{}}");

	add("spankies", "{\"term\":\"spankies\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|spank|ies|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Full underpants worn by cheerleaders, colour-coordinated as part of a matching outfit and designed to be seen under their skirts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Debbie Reed Fischer, \u0027Swimming with the Sharks\u0027, page 51\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The skirts flare out in just the right way, and our \u0027\u0027spankies\u0027\u0027 have little sequined sharks sewn on the rear\", \"priority\":3}]}, \"synonyms\":{}}");

	add("spanko", "{\"term\":\"spanko\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|spank|o|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person with a fetish for spanking, usually but not exclusively sexua\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spanner", "{\"term\":\"spanner\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|span|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hand tool for adjusting nuts and bolts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Pass me that \u0027\u0027spanner\u0027\u0027, Jake; there\u0027s just one more nut to screw in\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, spans\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1915\u0027\u0027, Florence Kiper Frank, \u0027The Jew to Jesus: and other poems\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The scheme of the \u0027\u0027spanner\u0027\u0027 of continents and the desire of the little husbandman hoarding for his loved ones\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A hand tool shaped like a small crank handle, for winding the spring of a wheel lock on a musket\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1786\u0027\u0027, Fig. 10. The spanner for spanning or winding up the spring of the wheel lock. \u0026amp;mdash; Francis Grose, \u0027A Treatise on Ancient Armour and Weapons\u0027, page xvi\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A device in early steam engines for moving the valves for the alternate admission and shutting off of the steam.\u0026lt;!--Webster 1913--\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A problem, dilemma or obstacle; something unexpected or troublesome (in the phrase \u0027spanner in the works\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Halfway through the production of Macbeth, the director found that the stage was smaller than he expected. This really threw a \u0027\u0027spanner\u0027\u0027 in the works\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A stupid or unintelligent person; one prone to making mistakes, especially in language\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"You \u0027\u0027spanner\u0027\u0027, Rodney! I wanted a Chinese, not an Indian\", \"priority\":12}]}, \"synonyms\":{}}");

	add("sparingness", "{\"term\":\"sparingness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of being sparing\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sparkler", "{\"term\":\"sparkler\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|sparkle|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hand-held firework that emits sparks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Marcus Collins, \u0027Modern Love\u0027 (page 258\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027Playboy\u0027 cover was of a girl in grey slacks and sandals, one hand on hip and the other waving a \u0027\u0027sparkler\u0027\u0027 for Independence Day\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A gem or ornament that sparkles\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1964\u0027\u0027, \u0027Mexican Life: Mexico\u0027s Monthly Review\u0027 (volume 40, page 65\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"When the bill came, I got a side-glance at it, and hoped Rose would have to hock her \u0027\u0027sparklers\u0027\u0027 to pay it\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A sparkling wine\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, Sheldon Wasserman, ‎Pauline Wasserman, \u0027Sparkling Wine\u0027 (page 238\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Irvine\u0027s white, a grape variety named for Hans Irvine, who developed the vineyards at Great Western (now owned by Seppelt), is frequently used in the Australian \u0027\u0027sparklers\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A tiger beetle\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"One who scatters; especially, one who scatters money; an improvident person\", \"priority\":11}]}, \"synonyms\":{}}");

	add("sparra", "{\"term\":\"sparra\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{eye dialect of|sparrow|from\u003dCockney|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sparrow\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Jon Wise, \u0027[http://www.people.co.uk/news/uk-world-news/2008/01/13/double-trouble-as-soap-won-t-wash-102039-20283927/ Double trouble as soap won\u0027t wash]\u0027, Peopl\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Jason dons a screwed-up accent that Madonna would be proud of. While Martine, loved for being a cockney \u0027\u0027sparra\u0027\u0027, unfortunately goes posh\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1859\u0027\u0027, Samuel Carter Hall, \u0027The book of the Thames: from its rise to its fall\u0027, [http://books.google.de/books?id\u003df5BQAAAAYAAJ\u0026amp;dq\u003dsparra\u0026amp;hl\u003dde\u0026amp;pg\u003dPA35\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dsparra\u0026amp;f\u003dfalse p. 351\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"quot;Ah ! ah ! the fun was, one of the company said it was as like a \u0027\u0027sparra\u0027\u0027 as one pea is like another; how I did laugh to myself, for she grew quite offended like, and insisted that this was a light brown bird, but that a \u0027\u0027sparra\u0027\u0027 was next to \u0027black\u0027\u0026quot;Category:en:True sparrows\", \"priority\":6}]}, \"synonyms\":{}}");

	add("sparrow", "{\"term\":\"sparrow\", \"etymology\":{\"influencers\":[{},{},{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"swiss german\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027sparwe\u0027 \u0027sparowe\u0027 from Old english (ca. 450-1100) \u0027spearwa\u0027 (sparrow) from Proto-germanic {{m|gem-pro|*sparwô}}, {{m|gem-pro|*sparwaz||sparrow}}, from Proto-indo-european {{m|ine-pro|*sper(w)-}}, {{m|ine-pro|*sper(g)-||sparrow, bird}}. Cognate with Dutch \u0027spreeuw\u0027 (starling) Swiss german \u0027spar\u0027 (sparrow) German \u0027sperling\u0027 (sparrow) Danish \u0027spurv\u0027 (sparrow) Swedish \u0027sparv\u0027 (sparrow) Breton \u0027frao\u0027 (crow) Tocharian A \u0027spārāñ\u0027 Ancient Greek \u0027ψάρ\u0027 (starling)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The house sparrow, \u0027Passer domesticus\u0027; a small bird with a short bill, and brown, white and gray feathers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A member of the family Passeridae, comprising small Old World songbirds\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A member of the family Emberizidae, comprising small New World songbirds\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Generically, any small, nondescript bird\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A quick-witted, lively person. Often used in the phrase \u0027cockney sparrow\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, \u0027[https://archive.is/20120730205401/www.bbc.co.uk/drama/faces/martine_mccutcheon.shtml Drama Faces: Martine McCutcheon]\u0027, BB\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Professional cockney \u0027\u0027sparrow\u0027\u0027 Martine has acted since childhood\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1878\u0027\u0027, \u0027Ally Sloper\u0027s guide to the Paris exhibition\u0027, Charles Henry Ross, page 54\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"I take it there \u0027s scarcely a happier fellow alive than your honest town-bred smoke-dried cockney \u0027\u0027sparrow\", \"priority\":9}]}, \"synonyms\":{}}");

	add("sparseness", "{\"term\":\"sparseness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|sparse|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being sparse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027sparseness\u0027\u0027 of the hair on his head made him long for his full haired youth\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The result or product of being sparse\", \"priority\":3}]}, \"synonyms\":{}}");

	add("sparsistency", "{\"term\":\"sparsistency\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|sparse|consistency|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Let \u0026lt;math\u0026gt; mathbf{b} \u0026lt;/math\u0026gt; be a vector and define the support \u0026lt;math\u0026gt; operatorname{supp}( mathbf{b}) \u003d {i : mathbf{b}_i neq 0 } \u0026lt;/math\u0026gt; where \u0026lt;math\u0026gt; mathbf{b}_i \u0026lt;/math\u0026gt; is the \u0026lt;math\u0026gt;i\u0026lt;/math\u0026gt;th element of \u0026lt;math\u0026gt; mathbf{b} \u0026lt;/math\u0026gt;. Let \u0026lt;math\u0026gt; hat{ mathbf{b}} \u0026lt;/math\u0026gt; be an estimator for \u0026lt;math\u0026gt; mathbf{b} \u0026lt;/math\u0026gt;. Then sparsistency is the property that the support of the estimator converges to the true support as the number of samples grows to infinity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spartacist", "{\"term\":\"spartacist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Spartacus|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A supporter of Spartacus, who led a slave rebellion against the ancient Roman Empire\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A member of , a left-wing Marxist revolutionary movement in Germany during and just after World War I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A member of the modern Spartacist League, or International Communist League, a Trotskyist international organisation\", \"priority\":3}]}, \"synonyms\":{}}");

